import './style.css'
import React from 'react';
import { BsInstagram } from 'react-icons/bs';
import { AiFillHome } from 'react-icons/ai';

export function Sidebar() {

    return(
        <div className="sidebar">
            <a> <BsInstagram/> </a>
            <a> <AiFillHome/> </a>
        </div>
    )

}
